// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;

import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/utils/EnumerableSet.sol";
import "./interfaces/IGoSwapToken.sol";
import "./libraries/AdminRole.sol";

// 迁移合约接口
interface IGoSwapHighway {
    // 执行从UniswapV2到GoSwap的LP Token迁移
    // 获取当前的LP Token地址并返回新的LP Token地址
    // 迁移者应该对调用者的LP Token具有完全访问权限
    // 返回新的LP Token地址
    //
    // XXX Migrator必须具有对UniswapV2 LP Token的权限访问权限
    //
    // GoSwap必须铸造完全相同数量的GoSwap LP Token，否则会发生不良情况。
    // 传统的UniswapV2不会这样做，所以要小心！
    function receiveMigrate(IERC20 token) external returns (IERC20);
}

// GoSwapHighway是GoSwap的主人。他可以生成GoSwapToken，而且他是个好人。
//
// 请注意，它是可拥有的，所有者拥有巨大的权力。
// 一旦GoSwapToken得到充分分配，所有权将被转移到治理智能合约中，
// 并且社区可以展示出自我治理的能力
//
// 祝您阅读愉快。希望它没有错误。上帝保佑。

contract GoSwapHighway is AdminRole {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    /// @notice 用户信息
    struct UserInfo {
        uint256 amount; // 用户提供了多少个LP Token。
        uint256 rewardDebt; // 已奖励数额。请参阅下面的说明。
        //
        // 我们在这里做一些有趣的数学运算。基本上，在任何时间点，授予用户但待分配的GoSwapToken数量为：
        //
        //   待处理的奖励 =（user.amount * pool.accGOTPerShare）-user.rewardDebt
        //
        // 每当用户将lP Token存入到池子中或提取时。这是发生了什么：
        //   1. 池子的每股累积GoSwapToken(accGOTPerShare)和分配发生的最后一个块号(lastRewardBlock)被更新
        //   2. 用户收到待处理奖励。
        //   3. 用户的“amount”数额被更新
        //   4. 用户的`rewardDebt`已奖励数额得到更新
    }

    /// @notice 池子信息
    struct PoolInfo {
        IERC20 lpToken; // LP Token合约的地址
        uint256 allocPoint; // 分配给该池的分配点数。 GoSwapToken按块分配
        uint256 lastRewardBlock; // GoSwapToken分配发生的最后一个块号
        uint256 accGOTPerShare; // 每股累积GoSwapToken乘以1e12。见下文
    }

    /// @notice The GoSwap TOKEN!
    IGoSwapToken public GOT;
    /// @notice Dev address.开发人员地址
    address public devaddr;
    /// @notice 奖励结束块号
    uint256 public bonusEndBlock;
    /// @notice 每块创建的GoSwapToken
    uint256 public GOTPerBlock;
    /// @notice 早期GoSwap Token的奖金乘数
    uint256 public constant BONUS_MULTIPLIER = 10;
    /// @notice 迁移者合同。它具有很大的力量。只能通过治理（所有者）进行设置
    IGoSwapHighway public migrator;

    /// @notice 池子信息数组
    PoolInfo[] public poolInfo;
    /// @notice 池子ID=>用户地址=>用户信息 的映射
    mapping(uint256 => mapping(address => UserInfo)) public userInfo;
    /// @notice 总分配点。必须是所有池中所有分配点的总和
    uint256 public totalAllocPoint = 0;
    /// @notice GoSwap Token挖掘开始时的块号
    uint256 public startBlock;

    /**
    * @dev 事件:存款
    * @param user 用户地址
    * @param pid 池子id
    * @param amount 存款数额
     */
    event Deposit(address indexed user, uint256 indexed pid, uint256 amount);

    /**
    * @dev 事件:取款
    * @param user 用户地址
    * @param pid 池子id
    * @param amount 取款数额
     */
    event Withdraw(address indexed user, uint256 indexed pid, uint256 amount);

    /**
    * @dev 事件:紧急提款
    * @param user 用户地址
    * @param pid 池子id
    * @param amount 存款数额
     */
    event EmergencyWithdraw(
        address indexed user,
        uint256 indexed pid,
        uint256 amount
    );

    /**
     * @dev 构造函数
     * @param _GOT GoSwap Token币地址
     * @param _devaddr 开发人员地址
     * @param _GOTPerBlock 每块创建的GoSwap Token令牌 1000000000000000000
     * @param _startBlock GoSwap Token挖掘开始时的块号
     * @param _bonusEndBlock 奖励结束块号
     */
    constructor(
        IGoSwapToken _GOT,
        address _devaddr,
        uint256 _GOTPerBlock,
        uint256 _startBlock,
        uint256 _bonusEndBlock
    ) public {
        GOT = _GOT;
        devaddr = _devaddr;
        GOTPerBlock = _GOTPerBlock;
        bonusEndBlock = _bonusEndBlock;
        startBlock = _startBlock;
    }

    /**
     * @dev 返回池子数量
     * @return 池子个数
     */
    function poolLength() external view returns (uint256) {
        return poolInfo.length;
    }

    /**
     * @dev 将新的lp添加到池中,只能由管理员调用
     * @param _allocPoint 分配给该池的分配点数。 GoSwap Token按块分配
     * @param _lpToken LP代币合约的地址
     * @param _withUpdate 触发更新所有池的奖励变量。注意gas消耗！
     */
    // XXX请勿多次添加同一LP令牌。如果您这样做，奖励将被搞砸
    function add(
        uint256 _allocPoint,
        IERC20 _lpToken,
        bool _withUpdate
    ) public onlyAdmin {
        // 触发更新所有池的奖励变量
        if (_withUpdate) {
            massUpdatePools();
        }
        // 分配发生的最后一个块号 = 当前块号 > GoSwap Token挖掘开始时的块号 > 当前块号 : GoSwap Token挖掘开始时的块号
        uint256 lastRewardBlock = block.number > startBlock
            ? block.number
            : startBlock;
        // 总分配点添加分配给该池的分配点数
        totalAllocPoint = totalAllocPoint.add(_allocPoint);
        // 池子信息推入池子数组
        poolInfo.push(
            PoolInfo({
                lpToken: _lpToken,
                allocPoint: _allocPoint,
                lastRewardBlock: lastRewardBlock,
                accGOTPerShare: 0
            })
        );
    }

    /**
     * @dev 更新给定池的GoSwap Token分配点。只能由所有者调用
     * @param _pid 池子ID,池子数组中的索引
     * @param _allocPoint 新的分配给该池的分配点数。 GoSwap Token按块分配
     * @param _withUpdate 触发更新所有池的奖励变量。注意gas消耗！
     */
    function set(
        uint256 _pid,
        uint256 _allocPoint,
        bool _withUpdate
    ) public onlyAdmin {
        // 触发更新所有池的奖励变量
        if (_withUpdate) {
            massUpdatePools();
        }
        // 总分配点 = 总分配点 - 池子数组[池子id].分配点数 + 新的分配给该池的分配点数
        totalAllocPoint = totalAllocPoint.sub(poolInfo[_pid].allocPoint).add(
            _allocPoint
        );
        // 池子数组[池子id].分配点数 = 新的分配给该池的分配点数
        poolInfo[_pid].allocPoint = _allocPoint;
    }

    /**
     * @dev 设置迁移合约地址,只能由所有者调用
     * @param _migrator 合约地址
     */
    function setMigrator(IGoSwapHighway _migrator) public onlyAdmin {
        migrator = _migrator;
    }

    /**
     * @dev 将lp令牌迁移到另一个lp合约。可以被任何人呼叫。我们相信迁移合约是正确的
     * @param _pid 池子id,池子数组中的索引
     */
    function migrate(uint256 _pid) public {
        // 确认迁移合约已经设置
        require(address(migrator) != address(0), "migrate: no migrator");
        // 实例化池子信息构造体
        PoolInfo storage pool = poolInfo[_pid];
        // 实例化LP token
        IERC20 lpToken = pool.lpToken;
        // 查询LP token的余额
        uint256 bal = lpToken.balanceOf(address(this));
        // LP token 批准迁移合约控制余额数量
        lpToken.safeApprove(address(migrator), bal);
        // 新LP token地址 = 执行迁移合约的迁移方法
        IERC20 newLpToken = migrator.receiveMigrate(lpToken);
        // 确认余额 = 新LP token中的余额
        require(bal == newLpToken.balanceOf(address(this)), "migrate: bad");
        // 修改池子信息中的LP token地址为新LP token地址
        pool.lpToken = newLpToken;
    }

    /**
     * @dev 给出from和to的块号,返回奖励乘积
     * @param _from from块号
     * @param _to to块号
     * @return 奖励乘积
     */
    function getMultiplier(uint256 _from, uint256 _to)
        public
        view
        returns (uint256)
    {
        // 如果to块号 <= 奖励结束块号
        if (_to <= bonusEndBlock) {
            // 返回 (to块号 - from块号) * 奖金乘数
            return _to.sub(_from).mul(BONUS_MULTIPLIER);
            // 否则如果 from块号 >= 奖励结束块号
        } else if (_from >= bonusEndBlock) {
            // 返回to块号 - from块号
            return _to.sub(_from);
            // 否则
        } else {
            // 返回 (奖励结束块号 - from块号) * 奖金乘数 + (to块号 - 奖励结束块号)
            return
                bonusEndBlock.sub(_from).mul(BONUS_MULTIPLIER).add(
                    _to.sub(bonusEndBlock)
                );
        }
    }

    /**
     * @dev 查看功能以查看用户的处理中尚未领取的GoSwap Token
     * @param _pid 池子id
     * @param _user 用户地址
     * @return 处理中尚未领取的GoSwap Token数额
     */
    function pendingToken(uint256 _pid, address _user)
        external
        view
        returns (uint256)
    {
        // 实例化池子信息
        PoolInfo storage pool = poolInfo[_pid];
        // 根据池子id和用户地址,实例化用户信息
        UserInfo storage user = userInfo[_pid][_user];
        // 每股累积GoSwap Token
        uint256 accGOTPerShare = pool.accGOTPerShare;
        // LPtoken的供应量 = 当前合约在`池子信息.lpToken地址`的余额
        uint256 lpSupply = pool.lpToken.balanceOf(address(this));
        // 如果当前区块号 > 池子信息.分配发生的最后一个块号 && LPtoken的供应量 != 0
        if (block.number > pool.lastRewardBlock && lpSupply != 0) {
            // 奖金乘积 = 获取奖金乘积(分配发生的最后一个块号, 当前块号)
            uint256 multiplier = getMultiplier(
                pool.lastRewardBlock,
                block.number
            );
            // GOT奖励 = 奖金乘积 * 每块创建的GoSwap Token令牌 * 池子分配点数 / 总分配点数
            uint256 GOTReward = multiplier
                .mul(GOTPerBlock)
                .mul(pool.allocPoint)
                .div(totalAllocPoint);
            // 每股累积GoSwap Token = 每股累积GoSwap Token + GOT奖励 * 1e12 / LPtoken的供应量
            accGOTPerShare = accGOTPerShare.add(
                GOTReward.mul(1e12).div(lpSupply)
            );
        }
        // 返回 用户.已添加的数额 * 每股累积GoSwap Token / 1e12 - 用户.已奖励数额
        return user.amount.mul(accGOTPerShare).div(1e12).sub(user.rewardDebt);
    }

    /**
     * @dev 更新所有池的奖励变量。注意汽油消耗
     */
    function massUpdatePools() public {
        // 池子数量
        uint256 length = poolInfo.length;
        // 遍历所有池子
        for (uint256 pid = 0; pid < length; ++pid) {
            // 升级池子(池子id)
            updatePool(pid);
        }
    }

    /**
     * @dev 将给定池的奖励变量更新为最新
     * @param _pid 池子id
     */
    function updatePool(uint256 _pid) public {
        // 实例化池子信息
        PoolInfo storage pool = poolInfo[_pid];
        // 如果当前区块号 <= 池子信息.分配发生的最后一个块号
        if (block.number <= pool.lastRewardBlock) {
            // 直接返回
            return;
        }
        // LPtoken的供应量 = 当前合约在`池子信息.lotoken地址`的余额
        uint256 lpSupply = pool.lpToken.balanceOf(address(this));
        // 如果 LPtoken的供应量 == 0
        if (lpSupply == 0) {
            // 池子信息.分配发生的最后一个块号 = 当前块号
            pool.lastRewardBlock = block.number;
            // 返回
            return;
        }
        // 奖金乘积 = 获取奖金乘积(分配发生的最后一个块号, 当前块号)
        uint256 multiplier = getMultiplier(pool.lastRewardBlock, block.number);
        // GOT奖励 = 奖金乘积 * 每块创建的GoSwap Token令牌 * 池子分配点数 / 总分配点数
        uint256 GOTReward = multiplier
            .mul(GOTPerBlock)
            .mul(pool.allocPoint)
            .div(totalAllocPoint);
        // 调用GOT的铸造方法, 为管理团队铸造 (`GOT奖励` / 10) token
        GOT.mint(devaddr, GOTReward.div(100));
        // 调用GOT的铸造方法, 为当前合约铸造 `GOT奖励` token
        GOT.mint(address(this), GOTReward);
        // 每股累积GoSwap Token = 每股累积GoSwap Token + GOT奖励 * 1e12 / LPtoken的供应量
        pool.accGOTPerShare = pool.accGOTPerShare.add(
            GOTReward.mul(1e12).div(lpSupply)
        );
        // 池子信息.分配发生的最后一个块号 = 当前块号
        pool.lastRewardBlock = block.number;
    }

    /**
     * @dev 将LP令牌存入MasterChef进行GoSwap Token分配
     * @param _pid 池子id
     * @param _amount 数额
     */
    function deposit(uint256 _pid, uint256 _amount) public {
        // 实例化池子信息
        PoolInfo storage pool = poolInfo[_pid];
        // 根据池子id和当前用户地址,实例化用户信息
        UserInfo storage user = userInfo[_pid][msg.sender];
        // 将给定池的奖励变量更新为最新
        updatePool(_pid);
        // 如果用户已添加的数额>0
        if (user.amount > 0) {
            // 待定数额 = 用户.已添加的数额 * 池子.每股累积GoSwap Token / 1e12 - 用户.已奖励数额
            uint256 pending = user
                .amount
                .mul(pool.accGOTPerShare)
                .div(1e12)
                .sub(user.rewardDebt);
            // 向当前用户安全发送待定数额的GOT
            safeGoSwapTransfer(msg.sender, pending);
        }
        // 调用池子.lptoken的安全发送方法,将_amount数额的lp token从当前用户发送到当前合约
        pool.lpToken.safeTransferFrom(
            address(msg.sender),
            address(this),
            _amount
        );
        // 用户.已添加的数额  = 用户.已添加的数额 + _amount数额
        user.amount = user.amount.add(_amount);
        // 用户.已奖励数额 = 用户.已添加的数额 * 池子.每股累积GoSwap Token / 1e12
        user.rewardDebt = user.amount.mul(pool.accGOTPerShare).div(1e12);
        // 触发存款事件
        emit Deposit(msg.sender, _pid, _amount);
    }

    /**
     * @dev 从MasterChef提取LP令牌
     * @param _pid 池子id
     * @param _amount 数额
     */
    function withdraw(uint256 _pid, uint256 _amount) public {
        // 实例化池子信息
        PoolInfo storage pool = poolInfo[_pid];
        // 根据池子id和当前用户地址,实例化用户信息
        UserInfo storage user = userInfo[_pid][msg.sender];
        // 确认用户.已添加数额 >= _amount数额
        require(user.amount >= _amount, "withdraw: not good");
        // 将给定池的奖励变量更新为最新
        updatePool(_pid);
        // 待定数额 = 用户.已添加的数额 * 池子.每股累积GoSwap Token / 1e12 - 用户.已奖励数额
        uint256 pending = user.amount.mul(pool.accGOTPerShare).div(1e12).sub(
            user.rewardDebt
        );
        // 向当前用户安全发送待定数额的GOT
        safeGoSwapTransfer(msg.sender, pending);
        // 用户.已添加的数额  = 用户.已添加的数额 - _amount数额
        user.amount = user.amount.sub(_amount);
        // 用户.已奖励数额 = 用户.已添加的数额 * 池子.每股累积GoSwap Token / 1e12
        user.rewardDebt = user.amount.mul(pool.accGOTPerShare).div(1e12);
        // 调用池子.lptoken的安全发送方法,将_amount数额的lp token从当前合约发送到当前用户
        pool.lpToken.safeTransfer(address(msg.sender), _amount);
        // 触发提款事件
        emit Withdraw(msg.sender, _pid, _amount);
    }

    /**
     * @dev 提款而不关心奖励。仅紧急情况
     * @param _pid 池子id
     */
    function emergencyWithdraw(uint256 _pid) public {
        // 实例化池子信息
        PoolInfo storage pool = poolInfo[_pid];
        // 根据池子id和当前用户地址,实例化用户信息
        UserInfo storage user = userInfo[_pid][msg.sender];
        // 调用池子.lptoken的安全发送方法,将_amount数额的lp token从当前合约发送到当前用户
        pool.lpToken.safeTransfer(address(msg.sender), user.amount);
        // 触发紧急提款事件
        emit EmergencyWithdraw(msg.sender, _pid, user.amount);
        // 用户.已添加数额 = 0
        user.amount = 0;
        // 用户.已奖励数额 = 0
        user.rewardDebt = 0;
    }

    /**
     * @dev 安全的GoSwap Token转移功能，以防万一舍入错误导致池中没有足够的GoSwap Token
     * @param _to to地址
     * @param _amount 数额
     */
    function safeGoSwapTransfer(address _to, uint256 _amount) internal {
        // GOT余额 = 当前合约在GOT的余额
        uint256 GOTBal = GOT.balanceOf(address(this));
        // 如果数额 > GOT余额
        if (_amount > GOTBal) {
            // 按照GOT余额发送GOT到to地址
            GOT.transfer(_to, GOTBal);
        } else {
            // 按照_amount数额发送GOT到to地址
            GOT.transfer(_to, _amount);
        }
    }

    /**
     * @dev 通过先前的开发者地址更新开发者地址
     * @param _devaddr 开发者地址
     */
    // Update dev address by the previous dev.
    function dev(address _devaddr) public {
        // 确认当前账户是开发者地址
        require(msg.sender == devaddr, "dev: wut?");
        // 赋值新地址
        devaddr = _devaddr;
    }
}

